import React from 'react';
import Logo from './../logo/Logo';

const Header = () => (
  <header className="header">
    <Logo />
    <p className="header__description">此站是學習 React 的練習作品，文章是幫自己加強印象的學習筆記，Happy Coding !</p>
  </header>
);

export default Header;
